import React, { Component } from "react";
import "./style.css";
class Cell extends Component {
  state = {
    columns: [9, 9, 9, 9, 9, 9]
  };

  renderGameBoard(columns) {
    for (let i = 0; i < columns.length; i++) {
      return <div className="cell" />;
    }
  }

  render() {
    return <div>{this.renderGameBoard(this.state.columns)}</div>;
  }
}
export { Cell };
